import React, { Component } from 'react';
import './App.css';

export default class App extends Component {
  messageClick(clicked) {
    if (clicked) {
      return "Mouse has been clicked";
    } else {
      return "Mouse has not been clicked";
    }
  };

  picClick(){
    //alert("Clicked")
    this.messageClick(true);
  }

  mouseDown() {
    alert("Mouse moved down")
  }

  render() {
  return (
      <>
      <div>
        <h2>{this.messageClick(false)}</h2>
        <img onClick={this.messageClick(true)} onDragStart={this.mouseDown}
        src="/images/campus_map_half.png" alt="" />

      </div>
    </>


  );

}
}
